INSERT INTO `atg_rowrequirement` VALUES (6589, '949.mcEngineLayout', 'Mode:mcEngineLayout', 'mcEngineLayout', 949, '<?xml version=\"1.0\" encoding=\"UTF-16\"?><stateMachine name=\"mcEngineLayout\">\n      <description>布局模式集，有压缩、正常两种模式</description>\n      <stateList>\n        <state enum=\"1\" initial=\"1\" name=\"mNormal\"/>\n        <state enum=\"1\" name=\"mCompressed\"/>\n      </stateList>\n      <stateTransition>\n        <row>\n          <source>mCompressed</source>\n          <event>@T(ipDMILayoutNormal=True AND tDMILayoutNormalStatus=Valid)</event>\n          <destination>mNormal</destination>\n        <reqID>23497</reqID></row>\n        <row>\n          <source>mNormal</source>\n          <event>@F(ipDMILayoutNormal=True AND tDMILayoutNormalStatus=Valid)</event>\n          <destination>mCompressed</destination>\n        <reqID>23498</reqID></row>\n      </stateTransition>\n    </stateMachine>');
