INSERT INTO `vrm_naturallanguagerequirement` VALUES (1120, 44, '<InternalParsedSignal> shall be set as <InternalSignal_FCM1> if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x1.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0. -AND- 2c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0. -AND- 2d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x1.) -OR- (3a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 3b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0. -AND- 3c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0. -AND- 3d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.)', 1);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1121, 44, '<InternalParsedSignal> shall be set as <InternalSignal_FCM2> if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0. -AND- 1c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0. -AND- 1d.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x1.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x1.) -OR- (3a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 3b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0. -AND- 3c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0. -AND- 3d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.)', 2);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1122, 44, '<InternalParsedSignal> shall be set as <InternalSignal_FCM3> if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0. -AND- 1c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x1.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0. -AND- 2c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x1.)', 3);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1123, 44, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 1 if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.)', 4);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1124, 44, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 2 if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.)', 5);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1125, 44, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 1 if: (1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6. -AND- 1b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.) -OR- (2a.<ipPFDDisplayFormat> is equal to one of 4,5,6. -AND- 2b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.)', 6);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1126, 44, 'When <ipIDUC_PFDReversionSide> is valid and equal to 2 -AND- <InternalIDU_id> is equal to 1 or 2, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_E> <InternalIRSSourceOut_status>=<ipIRSSource_E_status> <InternalIRSSourceIn>=<ipIRSSource_D> <InternalIRSSourceIn_status>=<ipIRSSource_D_status> <InternalIRSSourceCenter>=<ipIRSSource_B> <InternalIRSSourceCenter_status>=<ipIRSSource_B_status>', 7);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1127, 44, 'When (<ipIDUC_PFDReversionSide> is valid and not equal to 2 -OR- <ipIDUC_PFDReversionSide> is invalid) -AND- <InternalIDU_id> is equal to 1 or 2, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_E> <InternalIRSSourceOut_status>=<ipIRSSource_E_status> <InternalIRSSourceIn>=<ipIRSSource_D> <InternalIRSSourceIn_status>=<ipIRSSource_D_status> <InternalIRSSourceCenter>=0 <InternalIRSSourceCenter_status>=0', 8);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1128, 44, 'When <ipIDUC_PFDReversionSide> is valid and equal to 1 -AND- <InternalIDU_id> is equal to 3 or 4, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_E> <InternalIRSSourceOut_status>=<ipIRSSource_E_status> <InternalIRSSourceIn>=<ipIRSSource_D> <InternalIRSSourceIn_status>=<ipIRSSource_D_status> <InternalIRSSourceCenter>=<ipIRSSource_B> <InternalIRSSourceCenter_status>=<ipIRSSource_B_status>', 9);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1129, 44, 'When (<ipIDUC_PFDReversionSide> is valid and not equal to 1 -OR- <ipIDUC_PFDReversionSide> is invalid) -AND- <InternalIDU_id> is equal to 3 or 4, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_E> <InternalIRSSourceOut_status>=<ipIRSSource_E_status> <InternalIRSSourceIn>=<ipIRSSource_D> <InternalIRSSourceIn_status>=<ipIRSSource_D_status> <InternalIRSSourceCenter>=0 <InternalIRSSourceCenter_status>=0', 10);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1130, 44, 'When IDU_C display PFD in captain side (<ipPFDDisplayFormat>=1/2/3) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_E> <InternalIRSSourceOut_status>=<ipIRSSource_E_status> <InternalIRSSourceIn>=<ipIRSSource_D> <InternalIRSSourceIn_status>=<ipIRSSource_D_status> <InternalIRSSourceCenter>=0 <InternalIRSSourceCenter_status>=0', 11);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1131, 44, 'When IDU_C display PFD in first officer side (<ipPFDDisplayFormat>=4/5/6) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=<ipIRSSource_B> <InternalIRSSourceOut_status>=<ipIRSSource_B_status> <InternalIRSSourceIn>=<ipIRSSource_A> <InternalIRSSourceIn_status>=<ipIRSSource_A_status> <InternalIRSSourceCenter>=0 <InternalIRSSourceCenter_status>=0', 12);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1132, 44, 'When IDU_C doesn’t display PFD (<ipPFDDisplayFormat>=0/7) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be: <InternalIRSSourceOut>=0 <InternalIRSSourceOut_status>=0 <InternalIRSSourceIn>=0 <InternalIRSSourceIn_status>=0 <InternalIRSSourceCenter>=0 <InternalIRSSourceCenter_status>=0', 13);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1133, 44, 'IRS Source Indicator shall be displayed if: 1.<InternalPitchAngle_FCM> is invalid. -OR- 2.<InternalRollAngel_FCM> is invalid.', 14);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1134, 44, 'The N1 Indication shall display the left N1 readout in White Color state when: 1.ipFADECN1L is valid; -AND- 2a.ipFADECN1RedlineExceedanceL is invalid; -OR- 2b.ipFADECN1RedlineExceedanceL is valid and false.', 15);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1135, 44, 'The N1 Indication shall display the left N1 readout in Red Color state when: 1.ipFADECN1L is valid; -AND- 2.ipFADECN1RedlineExceedanceL is valid and true.', 16);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1136, 44, 'The N1 Indication shall display the left N1 readout in Invalid state when ipFADECN1L is invalid.', 17);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1137, 44, 'The N1 Indication shall display N1 readout in the format as X.X or XX.X when N1 value between 0-99.9.', 18);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1138, 44, 'The N1 Indication shall display N1 readout in the format as XXX when N1 value is equal or greater than 100.', 19);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1139, 44, 'The Stabilizer Trim Indication shall in Invalid state when: 1.ipFCSStabilizerPos is invalid; -AND- 2.ipFCSStabilizerPosValue is invalid.', 20);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1140, 44, 'The Trim Indication shall display stabilizer trim digital readout in Green color state when: 1.ipFCSStabilizerPos is valid; -AND- 2.ipFCSStabilizerPosValue is valid. -AND- 3.-2.5<=ipFCSStabilizerPos(involved display hysteresis)<=2.5 -AND- 4a.ipLGSALLGearWOW is valid and true. -OR- 4b.ipLGSALLGearWOW is invalid.', 21);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1141, 44, 'The Trim Indication shall display stabilizer trim digital readout in White color state when: 1.ipFCSStabilizerPos is valid; -AND- 2.ipFCSStabilizerPosValue is valid. -AND- 3a.ipLGSALLGearWOW is valid and false. -OR- 3b.((ipLGSALLGearWOW is valid and true) OR (ipLGSALLGearWOW is invalid)) AND ipFCSStabilizerPos(involved display hysteresis) is not within [-2.5,2.5].', 22);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1142, 44, 'When all DUs are available AND the reversion is not inhibited, the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to reconfigure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R Normal AUX PFD MFW MFW/EICAS MFW/EICAS MFW PFD AUX MFW MFW Note: <y> represents DU number which is from 1 to 5.', 23);
