INSERT INTO `vrm_naturallanguagerequirement` VALUES (1144, 44, 'When two DUs are unavailable AND the reversion is not inhibited AND <ipRCPEICASSelect> is either invalid or not REV , the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to configure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R DU1/2 fail EICAS MFW PFD AUX 1/2PFD MFW DU1/3 fail PFD AUX PFD AUX EICAS MFW DU1/4 fail PFD AUX AUX PFD EICAS MFW DU1/5 fail PFD AUX EICAS MFW PFD AUX DU2/3 fail AUX PFD PFD AUX EICAS MFW DU2/4 fail AUX PFD AUX PFD EICAS MFW DU2/5 fail AUX PFD EICAS MFW PFD AUX DU3/4 fail AUX PFD MFW EICAS MFW 1/2PFD DU3/5 fail AUX PFD MFW EICAS PFD AUX DU4/5 fail AUX PFD MFW EICAS AUX PFD Note: <y> represents DU number which is from 1 to 5.', 25);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1145, 44, 'When three DUs are unavailable AND the reversion is not inhibited AND <ipRCPEICASSelect> is either invalid or not REV, the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to configure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R DU1/2/3 fail MFW CFPD CFPD MFW DU1/2/4 fail MFW CFPD CFPD MFW DU1/2/5 fail EICAS MFW PFD AUX DU1/3/4 fail CPFD MFW MFW CFPD DU1/3/5 fail CPFD MFW MFW CFPD DU1/4/5 fail CPFD MFW MFW CPFD DU2/3/4 fail CPFD MFW MFW CFPD DU2/3/5 fail CPFD MFW MFW CFPD DU2/4/5 fail CPFD MFW MFW CPFD DU3/4/5 fail AUX PFD MFW EICAS Note: <y> represents DU number which is from 1 to 5.', 26);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1146, 44, 'When four DUs are unavailable AND the reversion is not inhibited, the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to configure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R DU1/2/3/4 fail CPFD MFW DU1/2/3/5 fail MFW CPFD DU1/2/4/5 fail MFW CPFD DU1/3/4/5 fail CPFD MFW DU2/3/4/5 fail CPFD MFW Note: <y> represents DU number which is from 1 to 5.', 27);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1147, 44, 'When two DUs are unavailable AND the reversion is not inhibited AND <ipRCPEICASSelect> is valid and REV, the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to configure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R DU1/2 fail MFW MFW MFW CPFD CPFD MFW DU1/3 fail CPFD MFW MFW CPFD MFW MFW DU1/4 fail CPFD MFW MFW CPFD MFW MFW DU1/5 fail CPFD MFW MFW MFW MFW CPFD DU2/3 fail CPFD MFW MFW CPFD MFW MFW DU2/4 fail CPFD MFW MFW CPFD MFW MFW DU2/5 fail CPFD MFW MFW MFW MFW CPFD DU3/4 fail CPFD MFW MFW MFW MFW CPFD DU3/5 fail CPFD MFW MFW MFW MFW CPFD DU4/5 fail CPFD MFW MFW MFW MFW CPFD Note: <y> represents DU number which is from 1 to 5.', 28);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1148, 44, 'When three DUs are unavailable AND the reversion is not inhibited AND <ipRCPEICASSelect> is valid and REV, the IMA Display Manager shall set <opDMIDU<y>Personality> to a corresponding value to configure its display as follows: Configuration DU1 DU2 DU3 DU4 DU5(Center) L R L R L R L R L R DU1/2/3 fail MFW CFPD CFPD MFW DU1/2/4 fail MFW CFPD CFPD MFW DU1/2/5 fail MFW MFW MFW CFPD DU1/3/4 fail CPFD MFW MFW CFPD DU1/3/5 fail CPFD MFW MFW CFPD DU1/4/5 fail CPFD MFW MFW CPFD DU2/3/4 fail CPFD MFW MFW CFPD DU2/3/5 fail CPFD MFW MFW CFPD DU2/4/5 fail CPFD MFW MFW CPFD DU3/4/5 fail CPFD MFW MFW MFW Note: <y> represents DU number which is from 1 to 5.', 29);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1149, 45, '除了安定面和尾舵面数据，当EICAS接收到的数据位于显示范围之外，但处于ICD定义的信息之内时，EICAS应该将该数据显示为无效。', 1);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1150, 45, '当EICAS收到的数据合法，且数据的读数范围在有效的显示范围内时，EICAS应认为该数据为有效。', 2);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1151, 45, 'N1指示应该采用下示的分辨率显示NA读数：1.0.1%对于(0%-99.9);2.1%对于100%及以上。', 3);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1152, 45, 'N1指示应显示N1指针为白色，当1.ipFDAECN1为合法，且2.a.ipFADECN1RedlineExceedance为不合法，或b.ipFADECN1RedlineExceedance为合法且为假。', 4);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1153, 45, 'N1指示应显示N1指针为红色，当1.ipFADECN1为合法，且2.ipFADECN1RedlineExceedance为合法且为真。', 5);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1154, 45, 'N1指示应显示N1读数为白色，当1.ipFADECN1为合法，且2.a.ipFADECN1RedlineExceedance为不合法，或b.ipFADECN1RedlineExceedance为合法且为假。', 6);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1155, 45, 'N1指示应显示N1读数为红色，当1.ipFADECN1为合法，且2.ipFADECN1RedlineExceedance为合法且为真。', 7);
