INSERT INTO `vrm_naturallanguagerequirement` VALUES (1159, 45, '当压缩EICAS进入防拥模式时，应移除起落架和襟缝翼指示。', 11);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1160, 45, '当EICAS进入防拥模式时，应设置op_EI_Declutter信号为真（适用于压缩和非压缩模式）。', 12);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1161, 45, '当EICAS退出防拥模式时，应设置op_EI_Declutter信号为假（适用于压缩和非压缩模式）。', 13);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1162, 46, '<InternalParsedSignal> shall be set as <InternalSignal_FCM1> if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x1.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0.\n-AND-\n2c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0.\n-AND-\n2d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x1.)\n-OR-\n(3a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n3b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0.\n-AND-\n3c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0.\n-AND-\n3d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.)', 1);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1163, 46, '<InternalParsedSignal> shall be set as <InternalSignal_FCM2> if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.\n-AND-\n1c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0.\n-AND-\n1d.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x1.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x1.)\n-OR-\n(3a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n3b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0.\n-AND-\n3c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x0.\n-AND-\n3d.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.)', 2);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1164, 46, '<InternalParsedSignal> shall be set as <InternalSignal_FCM3> if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.The Validity1(bit 15-8) of <InternalSignal_FCM1_status> is equal to 0x0.\n-AND-\n1c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x1.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.The Validity1(bit 15-8) of <InternalSignal_FCM2_status> is equal to 0x0.\n-AND-\n2c.The Validity1(bit 15-8) of <InternalSignal_FCM3_status> is equal to 0x1.)', 3);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1165, 46, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 1 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.)', 4);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1166, 46, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 2 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.)', 5);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1167, 46, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 3 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.)', 6);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1168, 46, 'When <ipIDUC_PFDReversionSide> is valid and equal to 2 -AND- <InternalIDU_id> is equal to 1 or 2, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=<ipIRSSource_B>\n<InternalIRSSourceCenter_status>=<ipIRSSource_B_status>', 7);
