INSERT INTO `vrm_naturallanguagerequirement` VALUES (1209, 47, 'When IDU_C display PFD in captain side (<ipPFDDisplayFormat>=1/2/3) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 11);
