INSERT INTO `vrm_naturallanguagerequirement` VALUES (1246, 53, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 1 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.)', 4);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1247, 53, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 2 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM3>.)', 5);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1248, 53, 'The Selected Source of (bit 23-16) <InternalParsedSignal_status> shall be set as 1 if:\n(1a.<ipPFDDisplayFormat> is not equal to one of 4,5,6.\n-AND-\n1b.<InternalParsedSignal> is set as <InternalSignal_FCM2>.)\n-OR-\n(2a.<ipPFDDisplayFormat> is equal to one of 4,5,6.\n-AND-\n2b.<InternalParsedSignal> is set as <InternalSignal_FCM1>.)', 6);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1249, 53, 'When <ipIDUC_PFDReversionSide> is valid and equal to 2 -AND- <InternalIDU_id> is equal to 1 or 2, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=<ipIRSSource_B>\n<InternalIRSSourceCenter_status>=<ipIRSSource_B_status>', 7);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1250, 53, 'When (<ipIDUC_PFDReversionSide> is valid and not equal to 2 -OR- <ipIDUC_PFDReversionSide> is invalid) -AND- <InternalIDU_id> is equal to 1 or 2, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 8);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1251, 53, 'When <ipIDUC_PFDReversionSide> is valid and equal to 1 -AND- <InternalIDU_id> is equal to 3 or 4, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=<ipIRSSource_B>\n<InternalIRSSourceCenter_status>=<ipIRSSource_B_status>', 9);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1252, 53, 'When (<ipIDUC_PFDReversionSide> is valid and not equal to 1 -OR- <ipIDUC_PFDReversionSide> is invalid) -AND- <InternalIDU_id> is equal to 3 or 4, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 10);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1253, 53, 'When IDU_C display PFD in captain side (<ipPFDDisplayFormat>=1/2/3) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_E>\n<InternalIRSSourceOut_status>=<ipIRSSource_E_status>\n<InternalIRSSourceIn>=<ipIRSSource_D>\n<InternalIRSSourceIn_status>=<ipIRSSource_D_status>\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 11);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1254, 53, 'When IDU_C display PFD in first officer side (<ipPFDDisplayFormat>=4/5/6) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=<ipIRSSource_B>\n<InternalIRSSourceOut_status>=<ipIRSSource_B_status>\n<InternalIRSSourceIn>=<ipIRSSource_A>\n<InternalIRSSourceIn_status>=<ipIRSSource_A_status>\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 12);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1255, 53, 'When IDU_C doesn’t display PFD (<ipPFDDisplayFormat>=0/7) -AND- <InternalIDU_id> is equal to 5, the logic of <InternalIRSSource***> and <InternalIRSSource***_status> shall be:\n<InternalIRSSourceOut>=0\n<InternalIRSSourceOut_status>=0\n<InternalIRSSourceIn>=0\n<InternalIRSSourceIn_status>=0\n<InternalIRSSourceCenter>=0\n<InternalIRSSourceCenter_status>=0', 13);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1256, 53, 'IRS Source Indicator shall be displayed if:\n1.<InternalPitchAngle_FCM> is invalid.\n-OR-\n2.<InternalRollAngel_FCM> is invalid.', 14);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1257, 53, 'The Stabilizer Trim Indication shall in Invalid state when:\n1.ipFCSStabilizerPos is invalid;\n-AND-\n2.ipFCSStabilizerPosValue is invalid.', 15);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1258, 53, 'The Trim Indication shall display stabilizer trim digital readout in Green color state when:\n1.ipFCSStabilizerPos is valid;\n-AND-\n2.ipFCSStabilizerPosValue is valid.\n-AND-\n3.-2.5<=ipFCSStabilizerPos(involved display hysteresis)<=2.5\n-AND-\n4a.ipLGSALLGearWOW is valid and true.\n-OR-\n4b.ipLGSALLGearWOW is invalid.', 16);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1259, 53, 'The Trim Indication shall display stabilizer trim digital readout in White color state when:\n1.ipFCSStabilizerPos is valid;\n-AND-\n2.ipFCSStabilizerPosValue is valid.\n-AND-\n3a.ipLGSALLGearWOW is valid and false.\n-OR-\n3b.((ipLGSALLGearWOW is valid and true) OR (ipLGSALLGearWOW is invalid)) AND ipFCSStabilizerPos(involved display hysteresis) is not within [-2.5,2.5].', 17);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1260, 53, 'The N1 Indication shall display the left N1 readout in White Color state when:\n1.ipFADECN1L is valid;\n-AND-\n2a.ipFADECN1RedlineExceedanceL is invalid;\n-OR-\n2b.ipFADECN1RedlineExceedanceL is valid and false.', 18);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1261, 53, 'The N1 Indication shall display the left N1 readout in Red Color state when:\n1.ipFADECN1L is valid;\n-AND-\n2.ipFADECN1RedlineExceedanceL is valid and true.', 19);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1262, 53, 'The N1 Indication shall display the left N1 readout in Invalid state when ipFADECN1L is invalid.', 20);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1263, 53, 'The N1 Indication shall display N1 readout in the format as X.X or XX.X when N1 value between 0-99.9.', 21);
INSERT INTO `vrm_naturallanguagerequirement` VALUES (1264, 53, 'The N1 Indication shall display N1 readout in the format as XXX when N1 value is equal or greater than 100.', 22);
